def solve():
    s = "t44 t10 t22 t45 t1 t48 t25 t47 t50 t2 t46 t15 t26 t59 t51 t6 t15 t48 t10 t1 t39 t31 t15"

    def is_valid(grammar, string):
        try:
            import re
            import collections

            def generate(input_string, index, stack):
                if index == len(input_string):
                    yield stack.copy()
                else:
                    if input_string[index] in stack:
                        yield from stack
                    else:
                        if input_string[index] not in stack:
                            stack.append(input_string[index])
                            yield from generate(input_string, index + 1, stack)

            try:
                yield from generate(string, 0, [])
            except Exception as e:
                print(f"Error: {e}")
                return False

        except Exception as e:
            print(f"Error: {e}")
            return False


    # Find the valid grammar
    valid_grammar = []
    for input_string in generate(s, 0, set()):
        if input_string is not None:
            valid_grammar.append(input_string)

    if not valid_grammar:
        print("No")
        return

    print(is_valid(s, " ".join(valid_grammar)))

